// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/Context.sol";
import "@openzeppelin/contracts/proxy/Clones.sol";

import "./Repository.sol";

contract RepoFactory is Context {
	Repository rootAbiToken;

  event RepoCreate(address indexed repo, address indexed creatorToken, address indexed owner);

	constructor() Context() {
		rootAbiToken = new Repository();
	}

	function createRepo(CreatorToken creatorToken, uint8[64] calldata context) public returns (address) {
		Repository repo = Repository(Clones.clone(address(rootAbiToken)));

		repo.initialize(creatorToken, context);
		repo.transferOwnership(_msgSender());

    emit RepoCreate(address(repo), address(creatorToken), _msgSender());
		return address(repo);
	}
}
